('000000000002', '00003', '000000009', 'Наушники True Wireless Huawei Freebuds Pro угольный черный', 'Благодаря эргономичной форме наушники-вкладыши удобно сидят в ухе, обеспечивая полное погружение в мир музыки.\nВ комплект входят силиконовые насадки четырёх размеров. Выберите те, которые подходят именно вам.\nМодель HUAWEI FreeBuds 3i обеспечивает эффективное шумоподавление для высокого качества звучания с эффектом полного погружения.\nВ наушниках HUAWEI FreeBuds 3i установлено два внешних микрофона, которые распознают ваш голос на фоне окружающего шума, и один внутренний микрофон, он улавливает голос внутри ушных каналов, повышая общее качество звучания во время вызовов.\nБлагодаря правильно настроенной высокочувствительной диафрагме наушники HUAWEI FreeBuds 3i обеспечивают оригинальное сбалансированное звучание, а динамики диаметром 10 мм отвечают за мощные басы, чтобы вы могли насладиться каждой нотой.', '50141256', '', '[{\"id\":\"000000021\",\"index\":1,\"is_title\":false,\"type\":1,\"value\":\"29 Ом\"},{\"id\":\"000000016\",\"index\":2,\"is_title\":false,\"type\":1,\"value\":\"20 Гц - 20 кГц\"},{\"id\":\"000000015\",\"index\":3,\"is_title\":false,\"type\":4,\"value\":\"000000002\"},{\"id\":\"000000030\",\"index\":4,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000031\",\"index\":5,\"is_title\":false,\"type\":3,\"value\":false}]', '000003', NULL, NULL),
('000000000003', '00004', '000000011', 'Холодильник Bosch Serie | 4 VitaFresh KGN39XW27R', '', '20068499', '', '[{\"id\":\"000000070\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"}]', '000001', NULL, NULL),
