('000000000008', '00005', '000000020', 'Ноутбук Lenovo IdeaPad 3 Gaming 15IMH05 черный', '', '1655081', '', '[{\"id\":\"000000013\",\"index\":1,\"is_title\":false,\"type\":2,\"value\":3.2}]', '000006', NULL, NULL),
('000000000009', '00005', '000000020', 'Ноутбук ASUS TUF Gaming FX505DT-HN564T черный', 'Производительность ноутбука ASUS TUF Gaming FX505DT-HN507T обеспечивается четырехъядерным процессором AMD Ryzen 5 3550H с рабочей частотой 2.1 ГГц, Он обладает широким функционалом, может использоваться для динамичных игр, выполнения других операций, касающихся учебы или работы. Отличается прекрасной графикой, чистым звуком, четким и ярким изображением.\n\nНоутбук ASUS TUF Gaming FX505DT-HN507T оснащен экраном диагональю 15.6 дюйма с матрицей IPS и с разрешением 1920х1080. Лэптоп может использоваться для просмотра фильмов и сериалов, для работы с видеоконтентом различного содержания. Поддерживает технологии Wi-Fi и Bluetooth. Для долгосрочного хранения данных на SSD диске предусмотрено 256 Гб. Для подключения сторонних устройств и носителей информации используются предусмотренные порты и разъемы. Литий-ионная батарея обеспечивает автономную работу в течение нескольких часов.', '1655299', '', '[{\"id\":\"000000013\",\"index\":1,\"is_title\":false,\"type\":2,\"value\":3.2}]', '000007', NULL, NULL),
('000000000010', '00005', '000000020', 'Ноутбук HP Pavilion Gaming 15-ec1086ur черный', '', '4721670', '', '', '000008', NULL, NULL),
('000000000011', '00005', '000000006', 'Смартфон Nokia 2.4', 'Очень удобный', '4717711', '', '[{\"id\":\"000000017\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000014\",\"index\":2,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000003\",\"index\":3,\"is_title\":false,\"type\":6,\"value\":\"000009\"},{\"id\":\"000000004\",\"index\":5,\"is_title\":false,\"type\":7,\"value\":\"000000001\"},{\"id\":\"000000001\",\"index\":6,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000032\",\"index\":9,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000039\",\"index\":14,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000047\",\"index\":22,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000053\",\"index\":28,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000057\",\"index\":32,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000064\",\"index\":39,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000069\",\"index\":44,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000005\",\"index\":45,\"is_title\":false,\"type\":2,\"value\":0.1},{\"id\":\"000000006\",\"index\":46,\"is_title\":false,\"type\":2,\"value\":0.2},{\"id\":\"000000007\",\"index\":47,\"is_title\":false,\"type\":2,\"value\":0.11},{\"id\":\"000000008\",\"index\":48,\"is_title\":false,\"type\":2,\"value\":0.17}]', '000009', NULL, NULL),
('000000000012', '00005', '000000006', 'Huawei Honor 7A (розовый)', 'Huawei Honor 7A - смартфон с современным дизайном. На передней стороне размещается прочное и красивое 2,5D-стекло.\nТыльная сторона является матовой, а реализована она из высококачественного алюминия.\n\nДисплей в Honor 7A установлен 5,45-дюймовый FullView-дисплей с разрешением 1440x720.\n\nСмартфон Honor 7A оснащен 4-х ядерным процессором Mediatek MT6739. Здесь используются ядра Cortex-A53, которые работают на максимальной частоте 1500 МГц. В устройстве располагается ускоритель графики PowerVR GE8100.\n\nВстроенная память 16 Гб и 2 Гб оперативной памяти, а расширить внутреннее хранилище можно с помощью карт памяти до 256 Гб.\n\nAndroid 8.1 выступает в качестве операционной системы. При этом интерфейс модернизирован благодаря фирменной оболочке EMUI 8.1.\n\nВнутри аппарата находится несъемный аккумулятор с емкостью 3020 мАч.\n\nHuawei Honor 7A поддерживает две Nano-SIM одновременно. При этом карта памяти может быть установлена отдельно.\n\nИмеется встроенное FM-радио, а также модуль LTE.\n\nКамера\nВ Hu', '1678788', '', '[{\"id\":\"000000017\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000014\",\"index\":2,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000003\",\"index\":3,\"is_title\":false,\"type\":6,\"value\":\"000003\"},{\"id\":\"000000025\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000015\"},{\"id\":\"000000004\",\"index\":5,\"is_title\":false,\"type\":7,\"value\":\"000000007\"},{\"id\":\"000000001\",\"index\":6,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000027\",\"index\":7,\"is_title\":false,\"type\":2,\"value\":12},{\"id\":\"000000028\",\"index\":8,\"is_title\":false,\"type\":1,\"value\":\"сканер отпечатка пальца; быстрая зарядка; технология распознавания лица\"},{\"id\":\"000000032\",\"index\":9,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":10,\"is_title\":false,\"type\":2,\"val