('000000000022', '00005', '000000006', 'Huawei Honor 30i 128Gb (синий)', 'Тройная основная камера 48 МП на базе искусственного интеллекта. Ультра четкие фотографии даже при увеличении - большое количество пикселей позволяет создавать ультрачеткие изображения. Даже при увеличении, кадрировании или редактировании качество фотографий останется высоким. А алгоритмы искусственного интеллекта, проанализировав окружающие условия, предложат оптимальный режим съемки для максимального качественного изображения. Благодаря батарее емкостью 4000 мА*ч и интеллектуальному алгоритму энергосбережения вы можете заниматься рабочими делами и просматривать развлекательный контент целый день.', '1678780', '', '[{\"id\":\"000000017\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000014\",\"index\":2,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000003\",\"index\":3,\"is_title\":false,\"type\":6,\"value\":\"000003\"},{\"id\":\"000000025\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000015\"},{\"id\":\"000000004\",\"index\":5,\"is_title\":false,\"type\":7,\"value\":\"000000013\"},{\"id\":\"000000001\",\"index\":6,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000027\",\"index\":7,\"is_title\":false,\"type\":2,\"value\":12},{\"id\":\"000000028\",\"index\":8,\"is_title\":false,\"type\":1,\"value\":\"сканер отпечатка пальца; быстрая зарядка; технология распознавания лица\"},{\"id\":\"000000032\",\"index\":9,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":10,\"is_title\":false,\"type\":2,\"value\":6.3},{\"id\":\"000000036\",\"index\":11,\"is_title\":false,\"type\":4,\"value\":\"000000040\"},{\"id\":\"000000037\",\"index\":12,\"is_title\":false,\"type\":4,\"value\":\"000000017\"},{\"id\":\"000000038\",\"index\":13,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000039\",\"index\":14,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000040\",\"index\":15,\"is_title\":false,\"t