('000000000023', '00005', '000000006', 'Huawei Honor 10X Lite (розовый)', 'HONOR 10X Lite, функционирующий на базе процессора Kirin, обеспечит вам незабываемые впечатления от игр. Технология HONOR SuperCharge 22,5 Вт обеспечивает высокую скорость зарядки. Квадрокамера 48 МП с искусственным интеллектом. Сделайте свою жизнь комфортнее благодаря встроенному многофункциональному датчику NFC.', '17282823', '', '[{\"id\":\"000000017\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000014\",\"index\":2,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000003\",\"index\":3,\"is_title\":false,\"type\":6,\"value\":\"000003\"},{\"id\":\"000000025\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000015\"},{\"id\":\"000000004\",\"index\":5,\"is_title\":false,\"type\":7,\"value\":\"000000007\"},{\"id\":\"000000001\",\"index\":6,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000027\",\"index\":7,\"is_title\":false,\"type\":2,\"value\":12},{\"id\":\"000000028\",\"index\":8,\"is_title\":false,\"type\":1,\"value\":\"укрепленный корпус; FM-радио\"},{\"id\":\"000000032\",\"index\":9,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":10,\"is_title\":false,\"type\":2,\"value\":6.67},{\"id\":\"000000036\",\"index\":11,\"is_title\":false,\"type\":4,\"value\":\"000000039\"},{\"id\":\"000000037\",\"index\":12,\"is_title\":false,\"type\":4,\"value\":\"000000048\"},{\"id\":\"000000038\",\"index\":13,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000039\",\"index\":14,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000040\",\"index\":15,\"is_title\":false,\"type\":4,\"value\":\"000000022\"},{\"id\":\"000000041\",\"index\":16,\"is_title\":false,\"type\":4,\"value\":\"000000024\"},{\"id\":\"000000042\",\"index\":17,\"is_title\":false,\"type\":4,\"value\":\"000000026\"},{\"id\":\"000000043\",\"index\":18,\"is_title\":false,\"type\":1,\"value\":\"Kirin 710A\"},{\"id\":\"000000044\",\"in